    def generate_table(self):
        num_shots = self.spinBox_num_shot.value()
        self.tableWidget_shotxmodel.setRowCount(num_shots)
        for row in range(num_shots):
            shot_item = QTableWidgetItem(str(row+1))
            self.tableWidget_shotxmodel.setItem(row,0,shot_item)
            list_model = QComboBox()
            list_model.addItems([str(i+1) for i in range(int(self.comboBox_n_model.currentText()))])
            self.tableWidget_shotxmodel.setCellWidget(row,1,list_model)

